가이드 주는 방식이 신선. 세팅실수로 어그로 끌려 갈피 못잡음.
40분, 문제방 치곤 문제수 매우 많으니 시간분배 잘 할 것.

러너웨이와 머스트 땐 직원 친절하고 일 잘하셨는데 어젠 왜그랬는지? 평일이라고 교육 안하시나 ㅋㅋ;;;; 
세팅 실수가 있었음 그에 대한 사과가 있어야했고, 보상만 주고 끝.
보상 또한 인당에게 해준게 아닌 팀으로 해줌ㅋ;

현금할인으로 20,000원 냈는데 거스름돈 안줌. 나중에서야 깨달아 연락하니 사과는 커녕 매장으로 다시 와서 돈 받아갈 수 있냐고 물아봄;;; 이부분에서 ㅈㄴ 얼탱이 없었음. 6,000원 받아야하는데 그와중 2,000원 계좌로 보내주겠다는거임. 4,000원 할인칩 줬다고 빼먹은건지ㅋㅋㅋ 너무 어이없어서 웃음도 안나옴ㅋ;;; 
다시 처음부터 끝까지 결제 내용 문자 보냈더니 착오있었다고 6,000원 보내줌. 

친절을 떠나서 어느정도 개념은 있어야하는거 아닌가?
